import React from "react"
import { CardContent, Typography, Box } from "@material-ui/core"
import { CircularProgress } from "@mui/material"

export default function FormSuccess({ props }) {
	const { ...data } = props
	console.log(data.responseData.data.data[0])
	return (
		<CardContent>
			{data ? (
				<Box>
					<Typography variant='h3'>Congratulations!</Typography>
					<br />
					<Typography variant='h4'>
						{data.responseData.data.data[0].firstName}{" "}
						{data.responseData.data.data[0].lastName}
					</Typography>
					<br />
					<Typography variant='body1'>
						You have successfully signed up! On
						data.responseData.data.data[0].createDate
					</Typography>
				</Box>
			) : (
				<CircularProgress />
			)}
		</CardContent>
	)
}
